    fun getURL(picPath:String?):String?{
        var myPath = picPath
        if (picPath == null){
            if (ConstantTestUrl.index>= ConstantTestUrl.arrayList.size){
                ConstantTestUrl.index = 0
            }
            myPath = ConstantTestUrl.arrayList[ConstantTestUrl.index]
            ConstantTestUrl.index ++
        }

        return myPath
    }
}




























